import React from 'react'
import {Button} from 'react-bootstrap'
function About() {
    return (
        <>
        <div className=" col-md-6 mt-3">
            <Button  variant="outline-info" href="https://github.com/DakshDesaiCoder" style={{borderRadius:"20px"}}>Ultra Coder</Button>
            </div>
        </>
    )
}

export default About
